export default function manageProjectsMasterList(state = {
    loading: false,
    projects: []
}, action){
    switch (action.type) {
        case 'LOADING_PROJECTS':
            debugger
        return{
            ...state, 
            loading: true
        }

        case 'RETURNED_PROJECTS_DATA':

        action.sheetData.shift()
        state.projects = action.sheetData
        debugger
        return {
            ...state
        }



        default:
           return state;
    }
}
